One of Arthur Rubinstein's favourite recordings of the Rachmaninov 3rd Piano Concerto by pianist Joseph Alfidi, recorded live in Brussels, 1972

In this video, you see Jo Alfidi with Rubinstein in his Paris apartment (TV documentary for Mexican audiences).

